      $('mergeCells', rels).before(_createNode(rels, 'autoFilter', {
        attr: {
          ref: 'A' + dataStartRow + ':' + createCellPos(data.header.length - 1) + dataEndRow
        }
      }));
      $('definedNames', workbook).append(_createNode(workbook, 'definedName', {
        attr: {
          name: '_xlnm._FilterDatabase',
          localSheetId: '0',
          hidden: 1
        },
        text: '\'' + _sheetname(config).replace(/'/g, '\'\'') + '\'!$A$' + dataStartRow + ':' + createCellPos(data.header.length - 1) + dataEndRow
      }));
    }

    // Let the developer customise the document if they want to
    if (config.customize) {
      config.customize(xlsx, config, dt);
    }

    // Excel doesn't like an empty mergeCells tag
    if ($('mergeCells', rels).children().length === 0) {
      $('mergeCells', rels).remove();
    }
    var jszip = _jsZip();
    var zip = new jszip();
    var zipConfig = {
      compression: 'DEFLATE',
      type: 'blob',
      mimeType: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet'
    };
    _addToZip(zip, xlsx);

    // Modern Excel has a 218 character limit on the file name + path of the file (why!?)
    // https://support.microsoft.com/en-us/office/excel-specifications-and-limits-1672b34d-7043-467e-8e27-269d656771c3
    // So we truncate to allow for this.
    var filename = exportInfo.filename;
    if (filename > 175) {
      filename = filename.substr(0, 175);
    }

    // Let the developer customize the final zip file if they want to before it is generated and sent to the browser
    if (config.customizeZip) {
      config.customizeZip(zip, data, filename);
    }
    if (zip.generateAsync) {
      // JSZip 3+
      zip.generateAsync(zipConfig).then(function (blob) {
        _saveAs(blob, filename);
        cb();
      });
    } else {
      // JSZip 2.5
      _saveAs(zip.generate(zipConfig), filename);
      cb();
    }
  },
  async: 100,
  filename: '*',
  extension: '.xlsx',
  exportOptions: {},
  header: true,
  footer: true,
  title: '*',
  messageTop: '*',
  messageBottom: '*',
  createEmptyCells: false,
  autoFilter: false,
  sheetName: ''
};

//
// PDF export - using pdfMake - http://pdfmake.org
//
DataTable.ext.buttons.pdfHtml5 = {
  className: 'buttons-pdf buttons-html5',
  available: function () {
    return window.FileReader !== undefined && _pdfMake();
  },
  text: function (dt) {
    return dt.i18n('buttons.pdf', 'PDF');
  },
  action: function (e, dt, button, config, cb) {
    var data = dt.buttons.exportData(config.exportOptions);
    var info = dt.buttons.exportInfo(config);
    var rows = [];
    if (config.header) {
      data.headerStructure.forEach(function (row) {
        rows.push(row.map(function (cell) {
          return cell ? {
            text: cell.title,
            colSpan: cell.colspan,
            rowSpan: cell.rowspan,
            style: 'tableHeader'
          } : {};
        }));
      });
    }
    for (var i = 0, ien = data.body.length; i < ien; i++) {
      rows.push(data.body[i].map(function (d) {
        return {
          text: d === null || d === undefined ? '' : typeof d === 'string' ? d : d.toString()
        };
      }));
    }
    if (config.footer) {
      data.footerStructure.forEach(function (row) {
        rows.push(row.map(function (cell) {
          return cell ? {
            text: cell.title,
            colSpan: cell.colspan,
            rowSpan: cell.rowspan,
            style: 'tableHeader'
          } : {};
        }));
      });
    }
    var doc = {
      pageSize: config.pageSize,
      pageOrientation: config.orientation,
      content: [{
        style: 'table',
        table: {
          headerRows: data.headerStructure.length,
          footerRows: data.footerStructure.length,
          // Used for styling, doesn't do anything in pdfmake
          body: rows
        },
        layout: {
          hLineWidth: function (i, node) {
            if (i === 0 || i === node.table.body.length) {
              return 0;
            }
            return 0.5;
          },
          vLineWidth: function () {
            return 0;
          },
          hLineColor: function (i, node) {
            return i === node.table.headerRows || i === node.table.body.length - node.table.footerRows ? '#333' : '#ddd';
          },
          fillColor: function (rowIndex) {
            if (rowIndex < data.headerStructure.length) {
              return '#fff';
            }
            return rowIndex % 2 === 0 ? '#f3f3f3' : null;
          },
          paddingTop: function () {
            return 5;
          },
          paddingBottom: function () {
            return 5;
          }
        }
      }],
      styles: {
        tableHeader: {
          bold: true,
          fontSize: 11,
          alignment: 'center'
        },
        tableFooter: {
          bold: true,
          fontSize: 11
        },
        table: {
          margin: [0, 5, 0, 5]
        },
        title: {
          alignment: 'center',
          fontSize: 13
        },
        message: {}
      },
      defaultStyle: {
        fontSize: 10
      }
    };
    if (info.messageTop) {
      doc.content.unshift({
        text: info.messageTop,
        style: 'message',
        margin: [0, 0, 0, 12]
      });
    }
    if (info.messageBottom) {
      doc.content.push({
        text: info.messageBottom,
        style: 'message',
        margin: [0, 0, 0, 12]
      });
    }
    if (info.title) {
      doc.content.unshift({
        text: info.title,
        style: 'title',
        margin: [0, 0, 0, 12]
      });
    }
    if (config.customize) {
      config.customize(doc, config, dt);
    }
    var pdf = _pdfMake().createPdf(doc);
    if (config.download === 'open' && !_isDuffSafari()) {
      pdf.open();
    } else {
      pdf.download(info.filename);
    }
    cb();
  },
  async: 100,
  title: '*',
  filename: '*',
  extension: '.pdf',
  exportOptions: {},
  orientation: 'portrait',
  // This isn't perfect, but it is close
  pageSize: navigator.language === 'en-US' || navigator.language === 'en-CA' ? 'LETTER' : 'A4',
  header: true,
  footer: true,
  messageTop: '*',
  messageBottom: '*',
  customize: null,
  download: 'download'
};
export default DataTable;

